import React from 'react';
import './App.css';
import UDPComponent from './App-UDPComponent';

const App = () => {
  return (
    <div>
      <UDPComponent localPort={50000} proxyHost="127.0.0.1" proxyPort={50001} />
      <UDPComponent localPort={50001} proxyHost="127.0.0.1" proxyPort={50000} />
    </div>
  );
};

export default App;
